    def check(self, instance):
        self.log.debug('running istio envoy check')
        envoy_endpoint = instance.get('envoy_endpoint')

        send_buckets = instance.get('send_histograms_buckets', True)
        # By default we send the buckets.
        if send_buckets is not None and str(send_buckets).lower() == 'false':
            send_buckets = False
        else:
            send_buckets = True

        self.process(envoy_endpoint, send_histograms_buckets=send_buckets, instance=instance)
